import React from 'react';
import  SignUpForm from '../components/Form';

const SignUp = () => {
    return (
        <div className="text-center flex-column">
            <h1 className="h3 mb-1 font-weight-normal">
                Create your account
            </h1>
            <SignUpForm />
            <p className="mt-5 text-muted">
                &copy; SafeCloud 2020
            </p>
        </div>
    );
}

export default SignUp;
